//全てのreducerを一つのreducerに結合する役割のファイル

import { combineReducers } from 'redux'
import count from './events'

//複数存在する場合は、ここにそのコンポーネントを列挙する
//例　：　export default combineReducers({count, time})
export default combineReducers({count})
